import { Component } from "react";

class Login extends Component{
    render(){
        return(
            <div className="container-fluid card">
                <h1 className="text-white text-center display-1 py-1" style={{ fontFamily: "cinematic" }}> Welcome Back !</h1>
                <div className="row">
                  
                    <div className="col-md-8 mx-auto">
                        <form>
                            <div className="mb-3">
                                <input type="text" className="form-control text-dark" id="exampleInputPassword1"  placeholder="Name" />
                            </div>
                            <div className="mb-3">
                                <input type="email" className="form-control " id="exampleInputEmail1" aria-describedby="emailHelp"  placeholder="Email address" />
                            </div>
                            <div className="mb-3">
                            <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" placeholder="Problem description"></textarea>
                            </div>

                            <div className="text-center">
                                <button type="submit" className="btn btn-danger w-100 text-dark">Send</button>
                                <br />
                                
                               
                               
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}

 export default Login;
